  }

  onInputChange = (event) => {
    console.log(event.target.value);
  }
  onSubmit = () => {
    console.log('click');
  }
  render(){
      return (
          <div className="App">
          <Particles className='particles' 
                  params={particleOptions}
                  />
          <Navigation />
          <Logo />
          <Rank />
          <ImageLinkForm onInputChange={this.onInputChange}/>
          {/* {
          <FaceRecognition />} */}
        </div>
      );
    }
}

export default App;
